Articles.Content:
Because of course Squad didn't include any sanity checks with the bulkhead profile filter.  

M2X 1.8.3.5 : [SpaceDock](https://spacedock.info/mod/473/Mk2%20Stockalike%20Expansion)- [GitHub](https://github.com/SuicidalInsanity/Mk2Expansion/releases/download/1.8.3/Mk2Expansion-1.8.3.5.zip)  
Because the only change from the previous version is updating a few parts bulkhead profiles, I've also put together a <abbr title="Module Manager (mod)">MM</abbr> patch for those of you who don't want to download a whole new update:

Spoiler

//adds missing bulkhead profiles  

@PART[M2X\_AeroIntake]  

{  

    %bulkheadProfiles = size1, mk2  

}  

@PART[M2X\_MantaIntake]  

{  

    %bulkheadProfiles = mk2  

}  

@PART[M2X\_RootChineShort]  

{  

    %bulkheadProfiles = srf  

}  

@PART[Mk1ChineShort]  

{  

    %bulkheadProfiles = srf  

}

